import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import './css/style.css'
import { Stack } from '@mui/material';
import Button from '@mui/material/Button';



export default function TextField3() {
    return (
        <div>
            <TextField id="textField34" label="" variant="filled" color='primary' fullWidth />
            <Stack direction='row' alignItems="center"
                className='CurrencyRow' spacing={1}>
                <Button variant="text" className='button'>JPY</Button>
                <Button variant="text" className='button'>BHD</Button>


            </Stack>
        </div>
    )
}
